import React from 'react';
import {StyleSheet, css} from 'aphrodite';
import Header from "../../helpers/Headers";

const Main = () => {
    const style = StyleSheet.create({
        'body': {
            'margin': "10%",
            marginTop: "3%"
        }
    })
    return (
        <div className={css(style.body)}>
            <Header></Header>
            
        </div>
    );
};

export default Main;
